import React, { useEffect, useState } from "react";

const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(()=>{
    fetch('https://dummyjson.com/products/1').then((data)=>{
        data.json().then(result =>{
            console.log(result);
            setUser(result.data)
        })
    })
  },[])
  return (
    <>


            {
                user.map((user,index)=>
               <div key={index}>
                <h1>{user.id}</h1>
               </div>
                )
            }

    </>
  );
};

export default Api;
